function SignIn(props) {

  return (
     <section className="sign-up">
        <h2 className="sign-up__title">
            Регистрация
        </h2>
        <form className="sign-up__form">
        <input id="sign-up-email-input" name="sign-up-email" type="email" placeholder="Email" className="sign-up__input" required />
        <input id="sign-up-password-input" name="sign-up-password" type="password" placeholder="Email" className="sign-up__input" required />
        </form>
     </section>
  );
}

export default SignIn;
